import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id: 'e1', title:'some event'
    },
    {
        id: 'e2', title:'another event'
    },
    {
        id: 'e3', title:'someone s event'
    }
];

function EventsPage() {
  return (
    <>
    <h1>Etkinlikler</h1>
    <ul>
        {DUMMY_EVENTS.map(event => <li key={event.id}><Link to={event.id}></Link></li>)}
    </ul>
    </>
  )
}

export default EventsPage
